import React from "react";

import './style.css';

import { Col, Container, Row } from 'react-bootstrap';

type ArrayElements = {
  id: number,
  height: number,
  width: number
}

function Tester() {

  const ArraysOfCard: ArrayElements = [{
    id: 1,
    height: 12,
    width: 12,
    size(){
      return this.width * this.height
    }
  },
  {
    id: 2,
    height: 15,
    width: 15,
    size(){
      return this.width * this.height
    }
  },
  {
    id: 3,
    height: 23343,
    width: 32424,
    size(){
      return this.width * this.height
    }
  }];

  const ArraysOfCardOnMap = ArraysOfCard.map((ArrayOfCard) => 
  <Col key = {ArrayOfCard.id} lg = "4" md = "6" sm = "12">
    <div className = "card-wrapper">
      <h1>Математика</h1>
      <h4>Высота: {ArrayOfCard.height}</h4>
      <h4>Ширина: {ArrayOfCard.width}</h4>
      <h3>Площадь: {ArrayOfCard.size()}</h3>
    </div>
  </Col>
  )

  return (
    <>
    <Container fluid>
      <Row>
        {ArraysOfCardOnMap}
      </Row>
    </Container>
    </>
  );
}

export default Tester;
